import React from 'react';
import ReactDOM from 'react-dom';
import { Router } from 'react-router';
import App from './App';

ReactDOM.render(
  <Router>
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
  </Router>
);
